import React from 'react';
import background from './bg.gif';

const Footer = () => {
    return (
    <>
        <div id="Footer">
            <div id="bg"
            style={{ 
                backgroundImage: `url(${background})`,
                backgroundCover: `cover`,
                height: '90px',
                backgroundRepeat: 'no-repeat',
                backgroundColor: '#000',
                textAlign: 'center',
                color: '#fff',
              }}
            >
                <p
                style={{
                    backgroundColor: '#000',
                    width: '100px'
                }}
                >Powered by React</p>
            </div>
        </div>
    </>
    );
};

export default Footer;
